import React from "react";

function DriveVideoEmbed({videoUrl, height, width}) {

    return (
        <div style={{ position: "relative", width: "100%", paddingBottom: "177.78%" }}> {/* 9:16 = 9/16 = 0.5625 */}
            <iframe
                src={videoUrl}
                style={{
                    position: "absolute",
                    top: 0,
                    left: 0,
                    width: "15vw",
                    height: "26.6666666666vw",
                    border: "none",
                }}
                allow="autoplay"
                title="Google Drive Video"
            ></iframe>
        </div>
    );
}

export default DriveVideoEmbed;
